    false,nt"url": null,nt"notes": "This document includes a final environmental
    impact statement (EIS) for the Alaska Peninsula Refuge Comprehensive Conservation
    Plan. It describes five alternative plans for managing Alaska Peninsula Refuge (including
    the alternative selected as the Alaska Peninsula CCP). The document includes a description
    of the existing environment on the refuge and an assessment of the effects of implementing
    these alternatives. Each alternative provides different choices for addressing internal
    management concerns and for resolving public issues. The document has been revised
    to reflect comments made during the public review of the draft CCP/EIS. An overview
    of the Refuge is provided along with information about the planning process. Public
    involvement; potential problems affecting fish, wildlife, and habitats; and a description
    of the affected environment are provided.",nt"license_title": "License Not
